@Override
public Iterator<Path> iterator() {
  final Iterator<Path> iterator = delegate.iterator();
  return new Iterator<Path>() {
    @Override
    public boolean hasNext() {
      return iterator.hasNext();
    }

    @Override
    public Path next() {
      return new FilterPath(iterator.next(), fileSystem);
    }
  };
}

